import React from 'react'
import "../styles/Projects.css";

function Documentos () {
    return (
        <div className='home'>
          <div className='about'>
            <h2>Hi, my name is Ale</h2>
            <div className='prompt'>
              <p>A software developer with a passion for learning and creating </p>
            </div>
            
          </div>
        </div>
      )  
}

export default Documentos
